    if((props.i)=="1")
    var footer=["About us","Team","Careers","Swiggy Blog","Bug Bounty","Swiggy Super","Swiggy Corporate","Swiggy Instamart"];
    if((props.i)=="2")
    var footer=["Help & Support","Partner with us","Ride with us"];
